【シニアおやつ しっとりやわらか食感 和風クッキー あずき味の詳細】<br>
●食べやすさと美味しさにこだわった一口サイズの和風クッキーです。<br>
●しっとりやわらか製法で食べやすく仕上げました。<br>
●「和」の食材である、北海道産小豆を使用したこしあんを使った、上品な美味しさのあずきクッキーです。<br>
●たんぱく質も豊富に含みます。<br><br>

【ご注意】<br>
○食事介助の必要な方は飲み込む力に差がありますので、介助者の方は飲み込むまで様子を見守ってください。<br>
○開封後は吸湿や乾燥を避けるため袋の口を閉じて保存し、早めにお召し上がりください。<br>
○乳幼児向け商品ではありません。<br><br>

【原材料】<br>
小麦粉、大豆たんぱく、ショートニング、砂糖、こしあん、マーガリン、水飴、加糖卵黄、あずきソース、加糖脱脂練乳、食塩、加工デンプン、トレハロース、グリセリン、膨張剤、着色料(カラメル、クチナシ、ラック、カロテン)、香料<br><br>

【栄養成分】1袋21g当たり<br>
エネルギー：100kcaL、たんぱく質：3.5g、脂質：4.7g、炭水化物：11.0g、ナトリウム：36mg、(食塩相当量：0.1g)<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
21g×2<br><br>

【販売元】<br>
和光堂<br>
東京都千代田区神田司町2-14-3<br>
お電話：0120-88-9283<br><br>

【商品区分】<br>
介護<br><br>

[高齢者向けおやつ　高齢者向け食品] 

